import * as React from "react";
import {
  Box,
  Grid,
  Typography,
  List,
  ListItem,
  TextField,
  FormControl,
  Button,
} from "@mui/material";

const fieldStyle = {
  background: "white",
};

let studentNames = [
  "Mary Smith",
  "Joaquim Tochtermann",
  "Ahmed Mohammed",
  "Jules Reynolds",
  "Tuan Hong",
];

// TODO: Create function to map over student names after seeds are ready
const handleGenerate = () => studentNames.push(studentNames);
// function displayStudentList() {
//   return [0, 1, 2].map((value) =>
//     React.cloneElement(studentName, {
//       key: value,
//     })
//   );
// }

console.log(studentNames);

const StudentList = () => {
  return (
    <Box>
      <FormControl>
        <TextField
          id="student-name-form"
          variant="outlined"
          label="Write a name"
          color="primary"
          sx={fieldStyle}
        ></TextField>
        <p>Enter a student's name and click "GENERATE"</p>
        <Button
          id="generate-button"
          variant="contained"
          onClick={() => handleGenerate}
        >
          {" "}
          Generate{" "}
        </Button>
      </FormControl>

      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <Typography
            sx={{ mt: 4, mb: 2 }}
            variant="h6"
            component="div"
          ></Typography>
          <List id="student-name-list">
            {studentNames.map((student) => {
              return <ListItem disablePadding>{student} </ListItem>;
            })}
          </List>
        </Grid>
      </Grid>
    </Box>
  );
};
export default StudentList;
